// This is the top nav bar

header{
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 15vh;
    z-index: 11;
    display: flex;
    align-items: center;
    justify-content: space-between;
    text-transform: uppercase;

    .site-branding{
        margin-left: 5%;

        h1{
            font-size: 18px;
        }

        h3{
            display: none;
        }
    }

    .top-nav{
        display: grid;
        grid-template-columns: 1fr 1fr;
        align-items: center;
        margin-right: 5%;
        grid-gap: 20px;
        
        a{
            text-decoration: none;
            color: black;
            font-size: 12px;
        }
    }
}

@media (min-width: $breakpoint-medium){
    header{
        .site-branding{
            h1{
                font-size: 36px
            }

            h3{
                display: block;
            }
        }

        .top-nav{
            a{
                font-size: 18px;
            }
        }
    }
}



// This is the bottom nav bar

nav{
    width: 100%;
    // border: 1px solid red;
    position: fixed;
    bottom: 0;
}

.nav-items{
    height: 15vh;
    display: flex;
    width: 80%;
    justify-content: space-around;
    align-items: center;
    margin:  0 auto;
    list-style: none;
    z-index: 900;
    // border: 1px solid black;


    a{
        text-decoration: none;
        color: black;
        font-size: 3vmin;
        font-weight: 400;

        &.selected{
            font-weight: 700;
        }
    }
}

@media (min-width: $breakpoint-small){
    nav{
        .nav-items{
            width: 60%;
        }
    }
}
